import React from 'react';
import {Link,Outlet} from 'react-router-dom'
import UserDetails from './UserDetails'
function Contact(){
  const [note,setNote]=React.useState({
    Firstname:"",
    LastName:"",
    Email:""
  });

  function handleChange(event){
     const {name,value}=event.target;
     setNote(prevNote => {
      return {
        ...prevNote,
        [name]: value
      };
    });
  }

   const [notes, setNotes] = useState([]);

  function addNote(newNote) {
    setNotes(prevNotes => {
      return [...prevNotes, newNote];
    });
  }

  function deleteNote(id) {
    setNotes(prevNotes => {
      return prevNotes.filter((noteItem, index) => {
        return index !== id;
      });
    });
  }
    return(


      <div class="body">
       <Outlet />
      <form action="/" class="form-signin w-100 m-auto" method="post">
     <h2 class="h3 mb-3 fw-normal">Sign Up</h2>
      <input type="text"  name="fName" class="top form-control" id="floatingInput" placeholder="FirstName" onClick={handleChange}/>
      <input type="text"  name="lName" class="middle form-control"  placeholder="LastName" onClick={handleChange}/>
      <input type="email" name="mail" class="bottom form-control" id="floatingPassword" placeholder="name@example.com" onClick={handleChange}/>
      <Link to='login'>
      <button class="btn btn-primary w-100 py-2" type="submit" onClick={addNote}>Sign in</button>
    </Link>
    <p class="mt-5 mb-3 text-body-secondary">&copy; 2017â€“2023</p>
  </form>
     
  {notes.map((noteItem,index)=>{
            <UserDetails
            key={index}
            id={index}
            fName={noteItem.FirstName}
            lName={noteItem.LastName}
            mail={noteItem.Email}
          />
        
        })}
        

      </div>
    )
}

export default Contact;
